import React from 'react';

const GraphNode = ({ x, y,id, onClick }) => (
  <circle 
    cx={x}
    cy={y} 
    r="5" 
    className="dot" 
    id={"dot_"+id}
    onClick={onClick}
  />
);

const Graph = ({ structure, selectedNode, onNodeClick, properties }) => {

  const length = structure.length;
  const height = calcHeight(structure);
  console.log("Height: ", height);
  console.log("Length: ", length);
  let r = calcZoom(length, height);
  console.log("Zoom: ", r);

  function handleFork(array,x,y,properties) {
    let l = array[i].length;
    // calculate the integer division of the length of the array
    let half = l/2 ;
    for (let j = 0; j < l; j++) {
      let place = j - half + 0.5;
      const new_nodes = renderNodes(nodes[i][j], x + properties.varX, y + properties.varY*place);
      nodesRendered = nodesRendered.concat(new_nodes);
    }
    return nodesRendered
  }

  const renderNodes = (nodes, x, y) => {
    // Recursive function to render nodes and paths
    let nodesRendered = [];
    for(let i = 0; i < nodes.length; i++) {
      if (Array.isArray(nodes[i])) {
        const nodes = handleFork(nodes[i],x,y,properties);
        nodesRendered = nodesRendered.concat(nodes);
      } else {
        const node = nodes[i];
        nodesRendered.push(
          <GraphNode
            x={x}
            y={y}
            id={node}
            onClick={onNodeClick}
          />
        );
      }
    }
    return nodesRendered;
  };

  return (
    <svg width="100%" height="100%">
      {renderNodes(structure, startX, startY)}
    </svg>
  );
};

function calcHeight(structure) {
  let st = [];
  let height = 0;
  for (let i = 0; i < structure.length; i++) {
    if (Array.isArray(structure[i])) {
      new_h = structure[i].length;
      for (let j = 0; j < structure[i].length; j++) {
        new_h += calcHeight(structure[i][j]);
      }
      height = new_h
    }
    st.push(height);
  }
  // return the maximum height in the array
  return Math.max(...st);
}

function calcZoom(length, height) {
  return 1
}

const App = () => {
  const [selectedNode, setSelectedNode] = React.useState('N1');

  const graphStructure = ["N1", "N2", [["N3", "N4", "N5"], ["N5"]] , [["N6"],["N7"]] , "N8"];

  let properties = {
    startX: 0,
    startY: 0,
    varX: 30,
    varY: 20,
  }
  return (
    <Graph
      structure={graphStructure}
      selectedNode={selectedNode}
      onNodeClick={(nodeId) => setSelectedNode(nodeId)}
      properties={properties}
    />
  );
};


function Navigation({slideChanger}) {
    // JSX: JavaScript XML
    return <table style={{width:"100%"}}>
    <tr style={{display:"flex"}}>
      <td className="left">
        <span className="prev" onClick={() => {slideChanger(-1)}}>Previous</span>
      </td>
      <td className="middle" nota="InsertNavGraph">
        <div className="graph-container">
          <svg width="200" height="100" className="graph">
            <circle cx="20" cy="20" r="5" className="dot" id="dot1" stroke=""></circle>
            <circle cx="50" cy="50" r="5" className="dot" id="dot2"></circle>
            <circle cx="80" cy="20" r="5" className="dot" id="dot3"></circle>
            <line x1="20" y1="20" x2="50" y2="50" stroke="black" />
            <line x1="50" y1="50" x2="80" y2="20" stroke="black" />
            <line x1="80" y1="20" x2="120" y2="50" stroke="black" />
          </svg>
        </div>
      </td>
      <td className="right"><span className="next" onClick={() => {slideChanger(1)}} >Next</span></td>
    </tr>
  </table>
}

export default Navigation;
